INSERT INTO `admins` (`id`, `fristname`, `lastname`, `gender`, `dob`, `email`, `phone`, `password`, `address`, `city`, `state`, `country`, `image`, `role`, `public_stripe_key`, `stripe_key`, `google_api_key`, `support`, `about_app`, `is_deleted`, `fcm_token`, `device_id`, `createdAt`, `updatedAt`) VALUES
(1, 'Jeremy', 'Jefferson', 0, '0000-00-00', 'admin@admin.com', 1234567890, '$2a$10$2IAdZ6uVV9RLGlz/RH7DOeWuIBaUnhGftfbJKNg4bRVcRNmzzw5rW', 'dewas road mp', 'dewas', 'mp', 'india', '/users/default.png', 1, 'pk_test_51JPefvDP2XFf8VbJ7DXfjw81RfUtkFWdOoyLhGJhSwHTRr5mXcZtDeJHFMKFczbnuUrt3cWrtcmujxaPXtvgEEJ0009Dn1RjDp', 'sk_test_51JPefvDP2XFf8VbJlD7nu16JcDcYw2y2bgHxLA92priBa2BfV0ZXtcSrWFwC6f37aF1aHclpGA7YB8YHGWCDk2oi00vMtarPjR', 'AIzaSyDjO1KNOAGM7gtD0IqsQqtMPGPJlHwRDmM', '<p><strong>Live Chat Available:&nbsp;</strong> 9 AM -4 PM Eastern Monday - Friday&nbsp;</p><p><strong>During Snow Storms :</strong> Live chat will be open 24/7&nbsp;</p><p>Most questions and concerns can be resolved using our <a href=\"https://mowingandplowingapp.tawk.help\">Help Desk</a> .&nbsp;</p><figure class=\"table\"><table><tbody><tr><td><p>&nbsp;</p><p>&nbsp;</p></td></tr></tbody></table></figure><p>&nbsp;</p>', '<p><strong>When will my provider show up ?&nbsp;</strong></p><p>We give the provider until the end of the scheduled day to complete lawn mowing orders . Snow plowing orders are within 2 hours .&nbsp;</p><p><strong>What if it Rains?&nbsp;</strong></p><p>In the case of inclement weather we will automatically push your job back to the next day .&nbsp;</p><p><strong>Why was my card charged ?&nbsp;</strong></p><p>To ensure payment for our providers all jobs are pre-paid . If for some reason the provider does not complete the job we will issue a full Instant Refund .&nbsp;</p><p><strong>How do I cancel service?&nbsp;</strong></p><p>You can cancel service through your Mowing and Plowing APP or by using your online Portal . Fee may apply if provider has been picked. To Cancel look under any active job and locate the Cancel service button . This will immediately cancel the service .&nbsp;</p><p><strong>My Contractor did not show up ?&nbsp;</strong></p><p>Be Patient . We give the provider until the end of day to complete lawn mowing jobs . If Provider still does not show by the end of the day we can reschedule the job the next day . Our providers are very reliable but please remember they are human and stuff happens . ( equipment failure , Vehicle issues , family issues , etc ) .&nbsp;</p><p><strong>Do I need to be home when contractor is scheduled to work ?&nbsp;</strong></p><p>No , once you order our Professional team will automatically complete the job on a scheduled date. You will be updated during the entire process.</p><p>Here are the automatic alerts you will receive on each job.</p><p>1. On my way</p><p>2. Arrived at location</p><p>3. Started Job</p><p>4. Finished job</p><p>5. Completed pictures are sent / Leave a review .&nbsp;&nbsp;</p>', 0, '1', 1, '2021-08-06 06:31:35', '2022-01-31 11:11:52');
