INSERT INTO `faqs` (`id`, `title`, `description`, `is_deleted`, `createdAt`, `updatedAt`) VALUES
(1, 'ghhjgh', '<p><i><strong>Instant Jobs -</strong></i>If your job date says Instant you must complete that job immediately . These jobs are paid out at a higher rate.&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p><strong>How do I get Paid -</strong> We offer direct deposit for your convenience. Payments are made within 48 hours of the jobâ€™s completion.</p><p>&nbsp;</p><p>&nbsp;</p><p><i><strong>Lawn Mowing consist of &nbsp;- </strong></i>Mowing , string trimming , Edging ( w/trimmer) , Clean-Up</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p><i><strong>Why am I not seeing any jobs - </strong></i>1. All of the jobs in your area have been claimed 2. Your radius is too small 3. Your phone needs to be reset</p><p>&nbsp;</p><p>&nbsp;</p><p><i><strong>Payout</strong></i><strong> -</strong> Once job is marked completed we will check job and issue payment next day . Depending on your bank it may take 2-3 days to receive direct deposit.&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p><i><strong>When are jobs Due - Each job has a due date listed . This date was chosen by the customer and you must complete the job by the end of that day . &nbsp;If weather doesn\'t allow you to complete the job please contact support via live chat .&nbsp;</strong></i></p><p>&nbsp;</p><p>&nbsp;</p><p><i><strong>Customers Lawn or Driveway doesn\'t Match job description -</strong></i>If you run into this issue take a picture of the lawn or driveway and contact us . DO NOT START WORK . We will try to contact the customer and discuss a price adjustment . &nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p><i><strong>Contact Support - </strong></i>Contact support via Live Chat by clicking on the support tab.&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><h2>&nbsp;</h2><p>&nbsp;</p><p>&nbsp;</p>', 0, '2021-08-19 11:18:27', '2022-01-12 07:36:52');
