INSERT INTO `privacy_policies` (`id`, `description`, `is_deleted`, `createdAt`, `updatedAt`) VALUES
(1, '<p>&nbsp;</p><h2><strong>Mowing and Plowing, LLC</strong></h2><p>PRIVACY POLICY</p><p>Mowing and Plowing , LLC is committed to maintaining the accuracy, confidentiality, and security of your Personal Data. This Privacy Policy describes how your personal information is collected, used, and shared when you visit our website, friendlyneighborhoodhelp.com, download our mobile applications, sign up for an account or use any of our services. By visiting our website, downloading our applications or using any of our services, you agree to our Privacy Policy, which is outlined below.&nbsp; By visiting this website, you are accepting the practices described in our Privacy Policy and you consent to receive it via electronic form via publication on the world wide web between you (â€œyou,â€ â€œuser,â€ â€œyourâ€) and Mowing and Plowing, LLC (â€œthe Site,â€ â€œthe App,â€ â€œthe service,â€ â€servicesâ€, â€œus,â€ weâ€, \"our\", \"company\", \"website\", â€œMowing and Plowingâ€). This Privacy Policy is part of our Terms and Conditions which govern your use of the Site, App and Services.&nbsp; This Privacy Policy does not apply to any products, Services, websites, or content that are offered by third parties (â€œThird Party Servicesâ€, â€œservice providersâ€), which are governed by their respective privacy policies.</p><p>Please read this policy carefully to understand our practices regarding your personal data and how we treat it. By using our website, app or services, you acknowledge that you have read and understood and consent to this privacy policy.</p><p><strong>What Personal Information Do We Collect?</strong></p><p>Mowing and Plowing serves to connect homeowners with Vendors who perform lawn care, snow removal and related services. As part of these services, you may be asked to provide certain information about you and we may collect information automatically through your usage. You directly provide the majority of the information that we collect.</p><p>Depending on the Service, we collect personal information that you provide or input on the site, including:</p><ul><li>Name and Contact information, including your phone number;</li><li>Login details, including email address and password;</li><li>Payment information, including your address,</li><li>Date of Birth</li></ul><p>Additionally, we may collect information automatically about users via a variety of methods, such as cookies, web beacons, JavaScript, and log files. This information may include user IP addresses, browser types, domain names, device type, time stamp, referring URL and other log file information; user activities within the Service; aggregate and statistical information regarding overall server/visitor traffic and navigation patterns for the Service. Web servers collect this type of basic information automatically as part of Web log processes.</p><p><strong>How Do We Use Your Personal Information?</strong></p><p>We will use this information collected for the following purposes:</p><ul><li>To provide our services to you</li><li>To create an account on our website with login details for you</li><li>To send you communications regarding our services, including with marketing offers</li><li>To advertise or market to you</li><li>To better understand and serve your needs;</li><li>Respond to you regarding the reason you contacted us</li><li>To enhance your customer experience and improve our customer service</li><li>To comply with applicable legal obligations, including responding to a subpoena or court order</li></ul><p><strong>Do We Ever Share Your Personal Information with Third-Parties?</strong></p><p>We share the information we collect as follows:</p><p><i><strong>Legal Disclosures.</strong></i>&nbsp;We may disclose a service userâ€™s information (including personal information) where we believe that we are required to do so in order to comply with an applicable statute, regulation, rule or law, a subpoena, a warrant or administrative request, a court or regulatory order, or other valid legal processes. We may also disclose personal information where we believe it is necessary to identify, contact or bring legal action against someone who may be violating the Terms of Service for our Service, to detect fraud, for assistance with a delinquent account, as evidence in litigation in which we are involved, or to protect the safety and/or security of our users, the Service or the general public.</p><p><i><strong>Service Providers.</strong></i>&nbsp;We employ independent contractors, vendors and suppliers to provide specific services related to the Service. In addition to the Vendors we work with to provide the lawncare, snow plowing and related services, we also may have independent contractors for hosting and maintaining the Service, providing credit card processing and fraud screening, and developing applications for the Service, email services and marketing enrichment services.</p><p><i><strong>Business Transfers.</strong></i>&nbsp;We reserve the right to transfer information (including personal information) to a third party in the event of a sale, merger or other transfer of all or substantially all of the assets of Mowing and Plowing, LLC or any of its Affiliates (including as part of a bankruptcy proceeding). We may disclose personal information about Service users to our affiliated companies. Our affiliatesâ€™ use of your personal information will be in accordance with the terms of this Privacy Policy.</p><p><i><strong>Social Media Sharing.</strong></i>&nbsp;If a user chooses to share information such as a testimonial or other content and feedback through social media outlets, such as Facebook, Instagram, Yep and Twitter, third parties may receive information about a userâ€™s experience on the Service.</p><p><i><strong>Aggregate and De-Identified Information.</strong></i>&nbsp;We may also provide aggregate, anonymous or de-identified information about users and the Service for marketing and research purposes. For example, we might inform third parties regarding the number of unique users who visit the Service, the demographic breakdown of our registered users of the Service, and the educational progress of categories of users.</p><p><strong>Are there any Geographic Restrictions?</strong></p><p>Our website and services are intended for access and use within the United States only and we comply with applicable United States privacy laws. Our services are not intended for, or directed to, citizens, domiciles or residents of the European Union. By accessing the Sites, mobile applications and web-based services, you affirm that you are not a citizen, domicile or resident of the European Union.</p><p><strong>What Privacy Protections are there for third-party links used on the website?</strong></p><p>Content and information posted by the Company may contain links to other sites, including those of our business partners or affiliates. While we seek to link only to sites that share our high standards and respect for privacy and security, we are not responsible for the privacy practices used by other sites.</p><p><strong>How do you respond to Do Not Track requests?</strong></p><p>At this time, our Site does not have the ability to respond to â€œDo Not Trackâ€ signals received from various web browsers.</p><p><strong>What Additional Rights Do California Users Have?</strong></p><p>The California Consumer Privacy Act provides some California residents with the additional rights listed below.&nbsp;</p><p><strong>Right to Know.</strong>&nbsp;You have the right to know and see what data we have collected about you over the past twelve (12) months, including:</p><ul><li>The categories of personal information we have collected about you;</li><li>The categories of sources from which the personal information is collected;</li><li>The business or commercial purpose for collecting your personal information;</li><li>The categories of third parties with whom we have shared your personal information; and</li><li>The specific pieces of personal information we have collected about you.</li></ul><p><strong>We do not sell your personal information.</strong></p><p><strong>Right to Delete.</strong>&nbsp;You have the right to request that we delete the personal information we have collected from you (and direct our service providers to do the same). There are a number of exceptions, however, that include, but are not limited to, when the information is necessary for us or a third party to do any of the following:</p><ul><li>Provide you with a good or service, or otherwise perform a contract between us and you;</li><li>Detect security incidents, protect against malicious, deceptive, fraudulent, or illegal activity; or prosecute those responsible for that activity;</li><li>Fix our system in the case of a bug;</li><li>Protect the free speech rights of you or other users;</li><li>Comply with the California Electronic Communications Privacy Act (Cal. Penal Code Â§ 1546 et seq.);</li><li>Comply with a legal obligation; or</li><li>Make other internal and lawful uses of the information that are compatible with the context in which you provided it.</li></ul><p><strong>Other Rights.</strong>&nbsp;You have the right to request and obtain from us once a year, free of charge, information about the personal information (if any) we disclose to third parties for their own direct marketing purposes in the preceding calendar year. If applicable, this information would include a list of the categories of personal information that was shared and the names and addresses of all third parties with which we shared information in the immediately preceding calendar year. You also have the right not to be discriminated against for exercising any of the rights listed above.</p><p><strong>Exercising Your California Privacy Rights.&nbsp;</strong>To request access to or deletion of your personal information, or to exercise any other data rights under California law, you may write to us at&nbsp;hello@MowingandPlowing.com. Please include your full name and email address associated with your use of our services, along with why you are writing, so that we can process your request in an efficient manner.</p><p><strong>Response Timing and Format.</strong>&nbsp;We aim to respond to a consumer request for access or deletion within 45 days of receiving that request. If we require more time, we will inform you of the reason and extension period in writing.</p><p><strong>Are There Any Age Restrictions for Use of the Companyâ€™s Services?</strong></p><p>You must be at least 18 years old or older to gain access to our website or our services. This website is not intended for those who are under 18 years old.&nbsp; The Company does not knowingly collect any information from anyone who is under 18 years of age and does so in compliance with the Childrenâ€™s Online Privacy Protection Act. This website, as well as its contents and services, is directed solely to individuals who are at least 18 years old and older.&nbsp;</p><p>If we learn we have collected Personal Data from a child under 18 without parental consent, we will delete that information, unless we are legally obligated to retain such data. &nbsp; If you have any reason to believe we may have unknowingly collected data from a minor under the age of 18, please immediately send us an email at hello@MowingandPlowing.com.</p><p><strong>How Are Users Notified of Any Changes to this Policy?</strong></p><p>We may amend this Privacy Policy from time to time. We will provide notice of any material changes made to our Privacy Policy by prominently posting the revised Policy with an updated date of revision on our homepage. We encourage users to check this page periodically for any changes. If we make any material changes that affect information we have previously collected about you, we will provide you with notice, via email or within the Service.</p><p><strong>How Can I Contact the Company Regarding this Policy?</strong></p><p>If you have any questions about this Privacy Policy or our security measures at Mowing and Plowing, LLC, please contact us at&nbsp;hello@MowingandPlowing.com.</p><p><br><br>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p><br>&nbsp;</p>', 0, '2021-08-09 06:23:32', '2021-11-16 14:30:43');
