(1, '<h2><strong>TERMS AND CONDITIONS FOR CUSTOMERS</strong></h2><h3><strong>Mowing and Plowing , LLC</strong></h3><p>&nbsp;</p><p>Welcome to Mowing and Plowing, LLC (â€œthe Site,â€, â€œthe Appâ€, â€œthe service,â€ â€servicesâ€, â€œus,â€ â€œweâ€, \"our\", \"company\", \"website\", â€œMowing and Plowingâ€). The Site and the mobile application are operated by Mowing and Plowing, LLC (the \"Company,\" \"we,\" â€œourâ€ or \"usâ€). By accessing or using our Site, App or services you signify that you have read, understand and agree to be bound by these Terms and Conditions (\"Terms and Conditions or â€œAgreement\"), regardless of whether you are a registered user of the Site.&nbsp; By visiting our Site, using our App or signing up for any of our services, you engage in our Services (the â€œServiceâ€, â€œServicesâ€).&nbsp; These Terms and Conditions apply to all users of the Site who are browsers or customers. You must be at least 18 years old or older to gain access to our website and its contents. As used herein, â€œYou, â€œUserâ€ or \"Users\" means anyone who accesses and/or uses the Site, the App, or any of our services.&nbsp;&nbsp;</p><p>You can review the most current version of the Terms and Conditions at any time on this page. We reserve the right to update, change or replace any part of these Terms and Conditions, without notice, by posting updates and/or changes to our website. It is your responsibility to check this page periodically for any such changes. Your continued use of or access to the website following the posting of any changes constitutes acceptance of those changes.&nbsp;</p><p>This is a legal agreement between You and Mowing and Plowing, LLC. You should carefully read this agreement and the Companyâ€™s Privacy Policy, which is incorporated into and are part of this agreement. YOU MAY NOT USE OUR SERVICES IF YOU DO NOT AGREE TO THESE TERMS AND CONDITIONS, These Terms and Conditions are applicable to customers. Our relationship with our Vendors is governed by a separate Terms and Conditions for Vendors which is available below.</p><p>These Terms and Conditions were last updated on November 7, 2021.</p><p><strong>Section 1 â€“ Account Creation</strong></p><p>You need an account for most services provided by the Company, including to sign up for services. When setting up and maintaining your account, you must provide and continue to provide accurate and complete information, including a valid email address. The Company may terminate your account and your access to our services for any or no reason at any time in our sole discretion.&nbsp;</p><p><br>&nbsp;</p><p>You have complete responsibility for your account and everything that happens on your account, including for any harm or damage (to us or anyone else) caused by someone using your account without your permission. This means you need to be careful with your password. You may not transfer your account to someone else or use someone elseâ€™s account. If you contact us to request access to an account, we will not grant you such access unless you can provide us with the information that we need to prove you are the owner of that account. In the event of the death of a user, the account of that user will be closed.</p><p>You may not share your account login credentials with anyone else. You are responsible for what happens with your account and the company will not intervene in disputes between customers who have shared account login credentials. You must notify us immediately upon learning that someone else may be using your account without your permission (or if you suspect any other breach of security). We may request some information from you to confirm that you are indeed the owner of your account.&nbsp;</p><p>By creating an account, You agree that the we may send SMS text messages to the phone number you provide as part of the scheduling and use of our Services. As governed by our Privacy Policy, you agree to allow us to use Your information to enable us to provide our Services.</p><p>Users must be at least 18 years of age to create an account on Mowing and Plowing and use the Services. If you are below this age of consent to use online services, you may not create an account. If we discover that you have created an account that violates these rules, we will terminate your account.&nbsp;</p><p><strong>Section 2 - Access to the Service.</strong></p><p>2.1. &nbsp; &nbsp; Subject to your acceptance of and compliance with this Agreement, Company grants to you a non-exclusive, non-transferable, revocable limited license to use the Service and App. You may use our Website and/or our App to schedule on demand lawn care, landscaping, and other services offered by Us. Your use of the Service is conditioned upon your compliance with this Agreement; any use of the Service in violation of this Agreement will be regarded as an infringement of Companyâ€™s copyrights in and to the Service. ANY BREACH OF THIS AGREEMENT WILL RESULT IN THE TERMINATION OF YOUR ACCESS TO OUR SERVICES.</p><p>2.2.&nbsp; &nbsp; &nbsp; Company may change, modify, suspend, or discontinue any aspect of the Service at any time Such change, modification, suspension or discontinuation can be for any reason and is not limited to your breach of this Agreement. Company may also impose limits on certain features or restrict or prohibit your access to parts or all of the Service without notice or liability. You agree to be bound by any rules associated with third party applications or tools used within the Service.</p><p>2.3 By using our Services you represent and warrant that You have the legal right to contract for our Services to be provided to your property. You specifically acknowledge that We are relying on that representation when providing those Services.&nbsp;</p><p>2.4 Mowing and Plowing&nbsp; serves to connect homeowners with Vendors who perform lawn care, landscaping and related services. Mowing and Plowing, LLC hires independent contractors (â€œVendorsâ€)