onal, or any reason whatsoever. The Company reserves the right to determine final prevailing pricing. The pricing information published on the website may not reflect the prevailing pricing. The Company may, at its sole discretion, make promotional offers with different features and different rates to any of our customers. These promotional offers, unless made to you, will have no bearing whatsoever on your offer or contract. The Company may change the fees for our Services as we deem necessary for our business. We encourage you to check back at our website periodically if you are interested about how we charge for the Services.</p><p><strong>Section 5 - Privacy and Protection of Personal Information.&nbsp;</strong>Notwithstanding anything else to the contrary contained in these Terms of Use, Companyâ€™s collection, use, disclosure and sharing of any personally identifiable information you provide via the Site or use of our services shall be governed by our Privacy Policy. For further information regarding the Company\'s protection of your personal information, please refer to our Privacy Policy listed below.</p><p><strong>Section 6 - Disclaimers; Limitations; Waivers of Liability.</strong></p><p>6.1. FNH PROS, LLC MAKES NO REPRESENTATION OR WARRANTIES AS TO THE VENDORS, INCLUDING BUT NOT LIMITED TO THEIR QUALITY OF SERVICE OR INSURANCE STATUS. &nbsp; FNH PROS SERVES TO CONNECT HOMEOWNERS WITH VENDORS WHO PERFORM LAWNCARE, SNOW PLOWING, AND RELATED SERVICES AND FNH COLLECTS PAYMENTS FOR THE REMITTANCE TO THE VENDORS MINUS THE FEE FOR OUR INTERMEDIARY SERVICES. YOUR DEALINGS WITH THE VENDORS ARE SOLELY BETWEEN YOU AND THE VENDORS.&nbsp;&nbsp;</p><p>6.2 YOU EXPRESSLY AGREE THAT USE OF THE SERVICE IS AT YOUR OWN RISK AND IS PROVIDED ON AN â€œAS ISâ€ BASIS WITHOUT WARRANTIES OF ANY KIND, EITHER EXPRESS OR IMPLIED, INCLUDING WARRANTIES OF TITLE OR IMPLIED WARRANTIES OF NON-INFRINGEMENT, MERCHANTABILITY OR FITNESS FOR A PARTICULAR PURPOSE. WITHOUT LIMITING THE FOREGOING, NEITHER THE COMPANY NOR ITS AFFILIATES OR SUBSIDIARIES, OR ANY OF THEIR DIRECTORS, EMPLOYEES, AGENTS, OR ATTORNEYS (COLLECTIVELY, â€œFNH PARTIESâ€) WARRANT THAT THE SERVICE, INCLUDING THE INFORMATION MADE AVAILABLE THROUGH THE SERVICE, WILL BE UNINTERRUPTED, UNCORRUPTED, ACCURATE, RELIABLE, COMPLETE, CURRENT, TIMELY, AVAILABLE IN A PARTIULAR LOCATION OR TIME, BE ERROR-FREE, THAT DEFECTS WILL BE CORRECTED, OR THAT THE PAGES OR THE SERVER THAT MAKES THE SERVICE AVAILABLE ARE FREE FROM VIRUSES, WORMS OR OTHER HARMFUL COMPONENTS.</p><p>6.3. &nbsp; TO THE FULLEST EXTENT PERMITTED BY APPLICABLE LAW, THE FNH PARTIES WILL NOT BE LIABLE FOR ANY DIRECT, INDIRECT, INCIDENTAL, SPECIAL, EXEMPLARY OR CONSEQUENTIAL DAMAGES, PERSONAL INJURY/WRONGFUL DEATH, LOST OR ANTICIPATED PROFITS, LOST DATA, OR BUSINESS INTERRUPTION, THE USE OR MISUSE OF SUBMISSIONS OR CONTENT IN ANY WAY WHATSOEVER ARISING OUT OF THE USE OF, OR INABILITY TO USE, THE SERVICE, WHETHER OR NOT THE FNH PARTIES ARE ADVISED OF THE POSSIBILITY OF SUCH DAMAGES. IN THE EVENT THAT THE FOREGOING EXCLUSION OF LIABILITY IS FOUND BY A COURT OF COMPETENT JURISDICTION TO BE UNENFORCEABLE, THE PARTIES INSTEAD AGREE THAT THE FNH PARTIES WILL NOT BE LIABLE TO YOU FOR MORE THAN THE GREATER OF THE AMOUNT YOU HAVE PAID THE COMPANY IN THE NINETY (90) DAYS IMMEDIATELY PRECEDING THE DATE ON WHICH YOU FIRST ASSERT ANY SUCH CLAIM OR ONE HUNDRED DOLLARS.</p><p>6.4 IN THE EVENT OF ANY LOSS OR DAMAGE, YOU HEREBY RELEASE FNH PARTIES FROM CLAIMS, DEMANDS AND DAMAGES OF EVERY KIND OR NATURE, KNOWN OR UNKNOWN, SUSPECTED AND UNSUSPECTED, DIRECT OR INDIRECT, DISCLOSED AND UNDISCLOSED, ARISING OUT OF OR IN ANY WAY RELATED TO SUCH DISPUTES AND/OR THE SERVICES. YOU AGREE THAT THE ENTIRE RISK ARISING OUT OF YOUR USE OF THE SITE, APP OR THE SERVICES REMAINS SOLELY WITH YOU TO THE MAXIMUM EXTENT PERMITTED UNDER APPLICABLE LAW.</p><p>6.5 YOU AND THE COMPANY AGREE THAT THE WARRANTY DISCLAIMERS AND LIMITATIONS OF LIABILITY IN THIS AGREEMENT ARE MATERIAL, B